import './App.css';
import { QueryClientProvider, QueryClient} from 'react-query';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {Negocios} from './pages/Negocios';


const queryClient = new QueryClient()


function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <Router>
      <nav className="bg-slate-500 py-8 mb-8 items-end">
        <Link className="text-2xl px-2" to="/"> Home </Link>
        <Link className="text-2xl px-2" to="/negocios"> Negocios </Link>
        <Link className="text-2xl px-2" to="/profile/"> Profile </Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/rqnegocios/:negocioId" element={<RQNegocio/>}/>
        <Route path="/rqnegocios" element={<RQNegocios />} />
        <Route path="/profile/:username" element={<Profile />} />
      </Routes>
      <div> Foooter </div>
    </Router>



      <ReactQueryDevtools initialIsOpen={false} />    
      </QueryClientProvider>
  );
}

export default App;
